import React from "react";
import '.../pages/Login/App.css'

function Log() {
  return (
    <div className="divlogin">
      <h1>janela Login</h1>
            <input
            placeholder="digite o ligin"    
               /><br/>
            <input
            placeholder="digite sua senha"    
               /><br/>

               <button>Acessar</button>

            

    </div>
  );
}

export default Log;
